    public static void GenerateImage(String imgStr) {// Base64
        if (imgStr == null) // 
            return;
        final Base64.Decoder decoder = Base64.getDecoder();
        try {
            // Base64
            byte[] bytes = decoder.decode(imgStr);
            for (int i = 0; i < bytes.length; ++i) {
                if (bytes[i] < 0) {// 
                    bytes[i] += 256;
                }
            }
            // jpeg
            OutputStream out = new FileOutputStream("D:\\test.jpg");
            out.write(bytes);
            out.flush();
            out.close();
        } catch (Exception e) {
        }
    }

    public static String GetImageStr()
    {//Base64
        String imgFile = "D:\\UserData\\My Documents\\My Pictures\\timg.jpg";//
        InputStream in = null;
        byte[] data = null;
        //
        try
        {
            in = new FileInputStream(imgFile);
            data = new byte[in.available()];
            in.read(data);
            in.close();
        }
        catch (IOException e)
        {
            e.printStackTrace();
        }
        //Base64
        final Base64.Encoder encoder = Base64.getEncoder();
        return encoder.encodeToString(data);//Base64
    }

